import Head from 'next/head'
import styles from '../styles/Home.module.css'

export default function Home({data}) {
  return (
    <div>
      <Head>
        <title>物流查询</title>
        <link rel="icon" href="/favicon.ico" />
      </Head>

      <img src="/bg.png" className={styles.imgBg} />
      <div className={styles.mainBox}>
        <div className={styles.title}>物流查询</div>
        <div className={styles.train}>
          <img src="/train.png" />
        </div>
        <div className={styles.queryBox}>
          <input className={styles.searchIpt} />
          <span className={styles.searchBtn}>
            <img src="/search.png" className={styles.imgSearch} />
          </span>
        </div>
        <div className={styles.resultBox}>
          <div className={styles.resultTitle}>
            <div className={styles.time + ' ' + styles.timeLeft}>时间</div>
            <div className={styles.result}>时间和跟踪进度</div>
          </div>
          <div className={styles.resultContent}>
            <div className={styles.expressContent}>
              {
                data.length > 0 ? (
                  <div>
                    <ul className={styles.resultList}>
                      {
                        data.map(item => {
                          return (
                            <li className={styles.resultItem}>
                              <div className={styles.time + ' ' + styles.timeLeft}>{item.ftime}</div>
                              <div className={styles.dot}>
                                <span className={styles.outDot + ' ' + styles.dotBox}>
                                </span>
                                <span className={styles.inDot + ' ' + styles.dotBox}></span>
                              </div>
                              <div className={styles.text}>{item.context}</div>
                            </li>
                          )
                        })
                      }
                    </ul>
                  </div>
                ) : (
                <div className={styles.emptyBox}>
                  <img src="/wu.png" className={styles.bottomImg} />
                  <div className={styles.timeSty}>还没有任何信息哦～</div>
                </div>
                )
              }
            </div>
          </div>
        </div>
      </div>
    </div>
  )
}

export async function getStaticProps() {
  const res = await fetch('http://127.0.0.1:3000/api/hello')
  const data = await res.json()
  return {
    props: { data: data.data }
  }
}
